import { Payment } from "./payment/Payment";
import { CheckoutContextProvider } from "./CheckoutContext";
import { CheckoutSummary } from "./summary/CheckoutSummary";

interface Props {
}



export const Onboarding: React.FC<Props> = (Props) => {


   return (
        <CheckoutContextProvider>
             <AssistentFlow >
                <ProductOffers />
                <Payment />
                <CheckoutSummary />
                <AssistentContentContainer>
                    Fertig
                </AssistentContentContainer>
            </AssistentFlow> 
        </CheckoutContextProvider>
    )
}
